import React from "react";
import logo from "./logo_resize_500.png";
import classes from "./mydayheader.module.css";

import Figure from "react-bootstrap/Figure";
import "./mydayheader.module.css";

const MyDayHeader = () => {
  return (
    <div className={classes.myDay}>
      <Figure>
        <Figure.Image width={250} height={250} alt="myDay_logo" src={logo} />
        <Figure.Caption>
          Nulla vitae elit libero, a pharetra augue mollis interdum.
        </Figure.Caption>
      </Figure>
    </div>
  );
};

export default MyDayHeader;
